import { ProcessingResult, OpenLibrarySearchResult } from '../types';

const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:8000';

class ApiService {
  private baseUrl: string;

  constructor(baseUrl: string = API_BASE_URL) {
    this.baseUrl = baseUrl;
  }

  /**
   * Check if the backend is healthy and ready
   */
  async checkHealth(): Promise<{ status: string; pipeline: string }> {
    try {
      const response = await fetch(`${this.baseUrl}/health`);
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      return await response.json();
    } catch (error) {
      console.error('Health check failed:', error);
      throw new Error('Backend is not available');
    }
  }

  /**
   * Process an uploaded image through the Spinecat pipeline
   */
  async processImage(file: File): Promise<ProcessingResult> {
    try {
      const formData = new FormData();
      formData.append('file', file);

      const response = await fetch(`${this.baseUrl}/api/process-image`, {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.detail || `HTTP error! status: ${response.status}`);
      }

      const result = await response.json();

      // Debug logging
      console.log('Backend API response:', result);
      console.log('Spine regions from backend:', result.spine_regions);

      // Convert the API response to our frontend types
      const convertedResult = {
        image_url: URL.createObjectURL(file),
        total_spines: result.total_spines,
        successful_matches: result.successful_matches,
        perfect_matches: result.successful_matches,
        spine_regions: result.spine_regions.map((spine: any) => {
          // Debug logging for each spine
          console.log('Processing spine:', spine);
          console.log('Spine bbox:', spine.bbox);

          const bbox = spine.bbox || [];
          let x = 0, y = 0, width = 0, height = 0, rotation = 0;

          if (bbox.length >= 8) {
            const xCoords = [bbox[0], bbox[2], bbox[4], bbox[6]];
            const yCoords = [bbox[1], bbox[3], bbox[5], bbox[7]];
            x = Math.min(...xCoords);
            y = Math.min(...yCoords);
            width = Math.max(...xCoords) - x;
            height = Math.max(...yCoords) - y;

            if (bbox.length >= 4) {
              const dx = bbox[2] - bbox[0];
              const dy = bbox[3] - bbox[1];
              rotation = Math.atan2(dy, dx) * (180 / Math.PI);
            }

            console.log('Converted coordinates:', { x, y, width, height, rotation });
          } else {
            console.log('Invalid bbox length:', bbox.length);
          }

          const convertedSpine = {
            id: spine.id,
            x: x,
            y: y,
            width: width,
            height: height,
            rotation: rotation,
            confidence: spine.confidence,
            coordinates: bbox.length >= 8 ? [
              [bbox[0], bbox[1]], [bbox[2], bbox[3]], 
              [bbox[4], bbox[5]], [bbox[6], bbox[7]]
            ] : [],
            ocr_text: spine.ocr_text || "No OCR text available",
            denoised_text: spine.denoised_text || "No denoised text available",
          };

          console.log('Converted spine:', convertedSpine);
          return convertedSpine;
        }),
        book_matches: result.book_matches.map((match: any) => ({
          id: match.spine_id || `match_${Math.random()}`,
          title: match.title || "",
          author_name: match.author ? [match.author] : [],
          first_publish_year: match.year ? parseInt(match.year) : null,
          publisher: "",
          match_score: match.confidence || 0,
          match_type: match.confidence > 0.8 ? 'exact' : match.confidence > 0.6 ? 'strong' : match.confidence > 0.4 ? 'moderate' : 'weak',
          confidence: match.confidence || 0,
          ocr_text: match.ocr_text || "No OCR text available",
          spine_region_id: match.spine_id || "",
        })),
        ocr_failures: result.ocr_failures.map((failure: any) => ({
          spine_id: failure.spine_id,
          bbox: failure.bbox,
          confidence: failure.confidence,
        })),
        processing_time: result.processing_time,
      };

      // Debug logging for final result
      console.log('Final converted spine regions:', convertedResult.spine_regions.map((spine: any) => ({
        id: spine.id,
        x: spine.x,
        y: spine.y,
        width: spine.width,
        height: spine.height
      })));

      return convertedResult;
    } catch (error) {
      console.error('Image processing failed:', error);
      throw error;
    }
  }

  /**
   * Search for books using the Open Library API
   */
  async searchBooks(query: string, limit: number = 5): Promise<OpenLibrarySearchResult[]> {
    try {
      const response = await fetch(
        `${this.baseUrl}/api/search-books?query=${encodeURIComponent(query)}&limit=${limit}`
      );

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.detail || `HTTP error! status: ${response.status}`);
      }

      const result = await response.json();
      return result.results || [];
    } catch (error) {
      console.error('Book search failed:', error);
      throw error;
    }
  }

  /**
   * Get the current API status
   */
  getApiStatus(): { baseUrl: string; isAvailable: boolean } {
    return {
      baseUrl: this.baseUrl,
      isAvailable: false, // Will be updated by health check
    };
  }
}

// Create and export a singleton instance
export const apiService = new ApiService();

// Export the class for testing
export { ApiService };
